import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import App from '../App';
class Routes extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return (
            <Router>
                <Header />
                <Switch>
                    <Route exact path='/' component={App}></Route>
                </Switch>
            </Router>
        );
    }
}

Routes.propTypes = {};

export default Routes;
